import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Users from './components/Users';
import Categories from './components/Categories';
import Transactions from './components/Transactions';
import Login from './components/Login';
import Navbar from './components/Navbar';
import './App.css';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [userEmail, setUserEmail] = useState('');

  useEffect(() => {
    const user = localStorage.getItem('user');
    if (user) {
      setIsLoggedIn(true);
      setUserEmail(user);
    }
  }, []);

  const handleLogin = (email) => {
    setIsLoggedIn(true);
    setUserEmail(email);
  };

  const handleLogout = () => {
    localStorage.removeItem('user');
    setIsLoggedIn(false);
    setUserEmail('');
  };

  return (
    <Router>
      <div className="App">
        {/* Navbar with minimized logo */}
        {isLoggedIn && (
          <div style={{
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'space-between',
            padding: '10px 20px',
            backgroundColor: '#2a9d8f',
            color: 'white'
          }}>
            {/* Minimized top-left logo */}
            <img 
              src="/logo.png" 
              alt="Logo"
              style={{ width: '50px', height: '50px' }}
            />
            
            {/* Profile section */}
            <div style={{ display: 'flex', alignItems: 'center' }}>
              <img
                src="/logo.png" // using same logo as avatar
                alt="Profile"
                style={{ width: '40px', height: '40px', borderRadius: '50%', marginRight: '10px' }}
              />
              <span style={{ marginRight: '20px' }}>{userEmail}</span>
              <button
                onClick={handleLogout}
                style={{
                  padding: '5px 10px',
                  borderRadius: '5px',
                  cursor: 'pointer',
                  backgroundColor: '#264653',
                  color: 'white',
                  border: 'none'
                }}
              >
                Logout
              </button>
            </div>
          </div>
        )}

        <main>
          <Routes>
            <Route 
              path="/login" 
              element={
                <LoginWithLogo onLogin={handleLogin} />
              } 
            />
            {isLoggedIn ? (
              <>
                <Route path="/" element={<Dashboard />} />
                <Route path="/users" element={<Users />} />
                <Route path="/categories" element={<Categories />} />
                <Route path="/transactions" element={<Transactions />} />
              </>
            ) : (
              <Route path="*" element={<Navigate to="/login" />} />
            )}
          </Routes>
        </main>
      </div>
    </Router>
  );
}

// Wrapper for Login to show logo on left side
function LoginWithLogo({ onLogin }) {
  return (
    <div style={{ display: 'flex', height: '100vh' }}>
      {/* Left half with big logo */}
      <div style={{
        flex: 1,
        backgroundColor: '#9ccc9c',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center'
      }}>
        <img 
          src="/logo.png" 
          alt="Budget Planner Logo"
          style={{ width: '250px', height: '250px' }}
        />
      </div>

      {/* Right half with login form */}
      <div style={{ flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
        <Login onLogin={onLogin} />
      </div>
    </div>
  );
}

export default App;
